CREATE TABLE form_type (
    id MEDIUMINT NOT NULL AUTO_INCREMENT,
    name VARCHAR(255) NOT NULL,
    description TEXT NULL,
    pdf_template MEDIUMBLOB NULL,
    json_metadata MEDIUMTEXT NOT NULL,
    PRIMARY KEY (id)
);

CREATE TABLE form (
    id MEDIUMINT NOT NULL AUTO_INCREMENT,
    name VARCHAR(255) NOT NULL,
    json_data MEDIUMTEXT NOT NULL,
    PRIMARY KEY (id)
);

